def sort_facetook_priority_wall(user_name, actions):
    priority_dict = defaultdict(int)
    for action in actions:
        tokens = action.split()
        a = tokens[0]
        k = tokens[1][0]
        if k != 'p':
            b = tokens[3][:-2]
            d = 15
        elif k == 'c':
            b = tokens[3][:-2]
            d = 10
        else:
            b = tokens[2][:-2]
            d = 5
        if a == user_name:
            priority_dict[b] += d
        elif b == user_name:
            priority_dict[a] += d
        else:
            priority_dict[a]
            priority_dict[b]
    priority_groups = defaultdict(list)
    for (name, priority) in priority_dict.items():
        priority_groups[priority].append(name)
    for priority in priority_groups:
        priority_groups[priority] = sorted(priority_groups[priority])
    sorted_priorities = sorted(priority_groups.items(), reverse=True)
    sorted_names = []
    for (_, names) in sorted_priorities:
        sorted_names.extend(names)
